(1, 'About Visobotics', NULL, 'about-us', NULL, NULL, NULL, 'Visobotics is Nepal\'s leading robotics and automation company, pioneering the future of intelligent systems. Founded in 2015, we specialize in industrial automation, AI-powered robotics, and cutting-edge training programs. Our mission is to make robotics accessible and transform industries through automation.', NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2025-11-26 20:47:16', '2025-11-26 20:47:16'),
(2, 'Our Mission', NULL, 'our-mission', NULL, NULL, NULL, 'Our mission at Visobotics is to democratize robotics technology and empower businesses with intelligent automation. We believe in innovation, sustainability, and excellence in everything we build.', NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2025-11-26 20:47:16', '2025-11-26 20:47:16'),
(3, 'Why Choose Visobotics', NULL, 'why-choose-us', NULL, NULL, NULL, 'With 8+ years of expertise, 100+ successful automation projects, and a team of world-class robotics engineers, Visobotics is your trusted partner for robotics solutions. We deliver excellence, innovation, and reliable support.', NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2025-11-26 20:47:16', '2025-11-26 20:47:16');

