(1, 'Top 5 Robotics Trends in 2024', NULL, 'Gokul Subedi', 'robotics-trends-2024', NULL, NULL, NULL, 'Explore the latest trends in robotics including collaborative robots, AI integration, autonomous systems, and Industry 4.0 transformation. Learn how these technologies are reshaping manufacturing and logistics.', NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2025-11-26 20:47:16', '2025-11-26 20:47:16'),
(2, 'Getting Started with ROS: A Beginner\'s Guide', NULL, 'Rajesh Kumar', 'ros-beginners-guide', NULL, NULL, NULL, 'Complete beginner-friendly guide to Robot Operating System (ROS). Installation, basic concepts, creating your first node, and controlling a simulated robot in Gazebo.', NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2025-11-26 20:47:16', '2025-11-26 20:47:16'),
(3, 'How Computer Vision Transforms Robotics', NULL, 'Priya Sharma', 'computer-vision-robotics', NULL, NULL, NULL, 'Deep dive into computer vision applications in robotics. Object detection, tracking, SLAM, and real-world case studies of vision-guided robots in industry.', NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2025-11-26 20:47:16', '2025-11-26 20:47:16');

