(1, 'Python for Robotics', NULL, NULL, NULL, 'Comprehensive Python programming course focused on robotics applications. Learn Python basics, NumPy, OpenCV, and robot control libraries. Hands-on projects with simulated and real robots.', NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2025-11-26 20:47:16', '2025-11-26 20:47:16'),
(2, 'ROS (Robot Operating System) Fundamentals', NULL, NULL, NULL, 'Master ROS for robot development. Topics include nodes, topics, services, tf, navigation stack, and SLAM. Work with Gazebo simulator and real robot hardware.', NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2025-11-26 20:47:16', '2025-11-26 20:47:16'),
(3, 'Arduino & Robotics Workshop', NULL, NULL, NULL, 'Hands-on workshop covering Arduino programming, sensors, motors, and building autonomous robots from scratch. Perfect for beginners interested in robotics.', NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2025-11-26 20:47:16', '2025-11-26 20:47:16'),
(4, 'Machine Learning for Robotics', NULL, NULL, NULL, 'Learn how to apply machine learning and deep learning in robotics. Object detection with YOLO, reinforcement learning, and neural network training for robot perception.', NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2025-11-26 20:47:16', '2025-11-26 20:47:16'),
(5, 'Advanced Robotic Arm Programming', NULL, NULL, NULL, 'Deep dive into robotic arm kinematics, inverse kinematics, trajectory planning, and control. Program industrial robots using Python and ROS.', NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, '2025-11-26 20:47:16', '2025-11-26 20:47:16');

